import React from "react";
import contactimg from "./contact-img.jpg";

function Contact() {

    const imgColor = {
        "-webkit-filter" : "grayscale(100%)", /* Safari 6.0 - 9.0 */
        "filter" : "grayscale(100%)",
        width : "40%",
        display: "block",
       "margin-left" : "auto",
        "margin-right" : "auto"

    }

    return (
        <div>
            <img src={contactimg} alt="" style={imgColor}/>
        </div>
    )


}

export default Contact;
